import React from "react";
import Title from "./Title.js";
import Playlist from "./Playlist";
import Content from "./Content";
import Amplitude from "amplitudejs";
import Song from "./Song.js";

function Home() {



  const title = Title("MusMe","Welcome to MusMe: the Library to Find the Soundtrack for You");
  const content = Content(
  <div class = "columns">

    <div class = "column"style = {{paddingTop: 5, textAlign: "center"}} id = "homecontent">
        <div class = "block">
        <p>MusMe is an <h2 style = {{paddingTop: 10}}>affordable, subscription-based, royalty-free music library</h2> powered by TwinsMusic Enterprises, based in Pelham, New York, USA.</p>
      </div>
      <div class = "block"style = {{paddingTop: 20}}>
        <p> The library features original music, sound bites, ringtones, and sound effects fit for <h2 style = {{paddingTop: 10}}>hundreds of moods and settings.</h2></p>
      </div>
      <div class = "block"style = {{paddingTop: 10}}>
        <p> MusMe sets itself apart from other music libraries because all music in the library is <h2 style = {{paddingTop: 10}}>original acoustic music.</h2> </p>
      </div>
      <div class = "block"style = {{paddingTop: 10}}>
        <p>Each month, the MusMe team updates the library with <h2 style = {{paddingTop: 10}}>refreshing new music and sounds</h2 > so users will never run out of new content. </p>
      </div>
   </div>

    <div class = "column" id = "musicsamples">
      <div class = "title" style = {{textAlign: "center"}}>
        Featured Sounds
      </div>


      {
              Amplitude.init({
                "bindings": {
                  32: 'play_pause'
                },
                "songs": [
                    {
                        "name": "Risin' High (feat Raashan Ahmad)",
                        "url": "https://521dimensions.com/song/Ancient Astronauts - Risin' High (feat Raashan Ahmad).mp3"
                    },
                    {
                      "name": "sdfsdfsdfg",
                      "url": "https://upload.wikimedia.org/score/g/o/go253kxgq5a9t8ey5pa4a8kt8olx093/go253kxg.mp3"
                    },
                ]
            })

            }{Playlist(2)}



  </div>
</div>
  );
  return (
    <div> 
      {title}
      {content}
      <div class="player">
          <div class="bottom-container">
          <span class="amplitude-play-pause" amplitude-main-play-pause="true" id="play-pause" data-amplitude-song-index = '0'>
            play
          </span>
          <progress data-amplitude-song-index = '0' class="progress amplitude-song-played-progress" id="song-played-progress-1"></progress>
          </div>
          <div class="time-container">

            <span class="current-time">
              <span data-amplitude-song-index = '0' class="amplitude-current-minutes" ></span>:<span data-amplitude-song-index = '0' class="amplitude-current-seconds" ></span>
            </span>
            <span class="duration">
              <span data-amplitude-song-index = '0' class="amplitude-duration-minutes" ></span>:<span data-amplitude-song-index = '0' class="amplitude-duration-seconds" ></span>
            </span>
            </div>
            <div class="control-container">

            </div>
          <div class="meta-container">
            <span data-amplitude-song-index = '0' amplitude-song-info="name" amplitude-main-song-info="true" class="song-name"></span>
          </div>
        </div>
      <div class="player">
          <div class="bottom-container">
          <span class="amplitude-play-pause" data-amplitude-song-index = '1'>
            play
          </span>
          <progress data-amplitude-song-index = '1' class="progress amplitude-song-played-progress" id="song-played-progress-2"></progress>
          </div>
          <div class="time-container">

            <span class="current-time">
              <span data-amplitude-song-index = '1' class="amplitude-current-minutes" ></span>:<span data-amplitude-song-index = '1' class="amplitude-current-seconds" ></span>
            </span>
            <span class="duration">
              <span data-amplitude-song-index = '1' class="amplitude-duration-minutes" ></span>:<span data-amplitude-song-index = '1' class="amplitude-duration-seconds" ></span>
            </span>
            </div>
            <div class="control-container">

            </div>
          <div class="meta-container">
            <span data-amplitude-song-index = '0' amplitude-song-info="name" amplitude-main-song-info="true" class="song-name"></span>
          </div>
        </div>
    </div>



  );
}

export default Home;
